// bootstrap 5

import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Card from "./Card";
import Sdata from "./Sdata";

const App = (props) => {
  return (
    <>
      <h1 className="text-center"> Welcome </h1>
      <Card
        imgsrc={props.imgsrc}
        title={props.title}
      />
    </>
  );
};

export default App;
